    public string NovoUsuarioNome { get; set; }
    public string NovoUsuarioSenha { get; set; }

    public void InserirUsuario(string usuarioNome, string usuarioSenha)
    {
        Usuario usuario = new Usuario(usuarioNome, usuarioSenha);
        if (!string.IsNullOrEmpty(NovoUsuarioNome) && !string.IsNullOrEmpty(NovoUsuarioSenha) && !Usuario.CheckExistencia(LoginService.usuarios, usuario))
        {
            LoginService.usuarios.Add(new MeuPonto.Usuario(NovoUsuarioNome, NovoUsuarioSenha));
        }
    }

    private void RemoverUsuario(Usuario usuario)
    {
        LoginService.usuarios.Remove(usuario);
    }
    

